// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.19;

contract Shipment {
    struct ShipmentOrder {
        string firstname;
        string lastname;
        string email;
        string cargoType;
        string origin;
        string destination;
        string transportationMedium;
        uint256 quantity;
        uint256 weight;
        uint256 amount;
        uint256 _timestamp;
    }

    ShipmentOrder[] public shipmentOrders;
    mapping(address => ShipmentOrder) public payments;
    address public owner;
    uint256 timestamp;

    // events
    event logTrasaction(address indexed owner, uint256 amount, uint timestamp);
    event LogWithdrawal(address indexed owner, uint256 amount);

    // modifiers
    modifier isOwner() {
        require(msg.sender == owner, "must be owner");
        _;
    }

    /**
		-------------------------------------------------------
		-------------------------- [ Function] ----------------
		-------------------------------------------------------
	 */

    constructor() {
        owner = msg.sender;
    }

    function makePayment(
        address payable _to,
        uint256 _transferAmount,
        string memory _firstname,
        string memory _lastname,
        string memory _email,
        string memory _cargoType,
        string memory _origin,
        string memory _destination,
        string memory _transportationMedium,
        uint256 _quantity,
        uint256 _weight
    ) public payable returns (bool) {
        uint256 ownerBalance = address(owner).balance;
        require(ownerBalance >= _transferAmount, "Insufficient funds");

        // 		create and push shipemntOrder
        ShipmentOrder memory _order = ShipmentOrder(
            _firstname,
            _lastname,
            _email,
            _cargoType,
            _origin,
            _destination,
            _transportationMedium,
            _quantity,
            _weight,
            _transferAmount,
            timestamp
        );

        shipmentOrders.push(_order);
        payments[owner] = _order;
        emit logTrasaction(owner, _transferAmount, timestamp);

        // tranfer ower of contract
        (bool sent, ) = _to.call{value: _transferAmount}("");
        if (sent) return true;
        return false;
    }

    function getPayments(address _address) public view returns (ShipmentOrder memory){
        return payments[_address];
    }

    function withdraw(uint256 amount) public payable {
        (bool success, ) = payable(owner).call{value: amount}("");
        require(success, "Withdrawal failed.");
        emit LogWithdrawal(msg.sender, amount);
    }

    function getOwnwer() public view returns (address) {
        return owner;
    }
}
